#include <stdlib.h>
#include <string.h>

int largestRectangleArea(int* heights, int heightsSize){
    int max = 0, sum = 0;
    for (int i = 0; i < heightsSize; i++) {
        if (heights[i] != 0) { // 非0才计算 
	        sum = heights[i];
	        for(int j = i - 1; j >= 0; j--){
	            if(heights[j] >= heights[i]) {
	            	sum += heights[i];
				} else {
					break;
				}
	            if(heights[i] == heights[j]) {
	            	printf("heights[%d]=%d\n", j, heights[j]);
					//heights[j]--; // 标记已计算 
				} 
	        }
	        for(int k = i + 1; k < heightsSize; k++){
	            if(heights[k] >= heights[i]) {
	            	sum += heights[i];	
				} else {
					break;
				}
	            if(heights[k] == heights[i]) {
	            	printf("heights[%d]=%d\n", k, heights[k]);
	            	//heights[k]--;// 标记已计算
				}
	        }
	        if(max < sum) {
	        	max = sum;
			}
        }
    }
    return max;
}

